import * as React from 'react';
import styled from '@mui/system/styled';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import MenuIcon from '@mui/icons-material/Menu';
import EditIcon from '@mui/icons-material/Edit';

const StyledAppBar = styled(AppBar)({
  top: 'auto',
  bottom: 0,
  background: '#344955',
  boxShadow: 'none',
  borderTop: '1px solid #FCFCFC',
  position: 'fixed',
  width: '100%',
  '&::before': {
    content: '""',
    position: 'absolute',
    top: '-40%',
    left: '50%',
    transform: 'translateX(-50%)',
    width: '5%', // Ancho de la sección circular al 5%
    height: '100%',
    background: '#FCFCFC',
    borderRadius: '50%',
  },
});

const CenteredBox = styled('div')({
  display: 'flex',
  justifyContent: 'space-between',
  alignItems: 'center',
  width: '100%',
  padding: '0 16px',
  '@media only screen and (max-width: 600px)': {
    padding: '0 8px', // Ajuste de espacio entre elementos para pantallas más pequeñas
  },
});

const CircularIconButton = styled(IconButton)({
  borderRadius: '50%',
  backgroundColor: '#F9AA33',
  '&:hover': {
    backgroundColor: '#F9AA33',
  },
  width: '40px',
  height: '40px',
  '@media only screen and (max-width: 600px)': {
    width: '32px',
    height: '32px',
  },
});

const HomeIconButton = styled(CircularIconButton)({
  marginLeft: '-8px',
  '@media only screen and (max-width: 600px)': {
    width: '32px',
    height: '32px',
  },
});

// Componente de barra de navegación
const NavigationComponent = () => {
  // ... (código de la barra de navegación)
  return <div>Barra de Navegación</div>;
};

export default function BottomAppBarWithNavigation() {
  return (
    <div>
      {/* Barra de aplicación inferior */}
      <StyledAppBar>
        <Toolbar>
          <CenteredBox>
            <IconButton size="large" edge="start" color="#ecf3f3" aria-label="open drawer">
              <MenuIcon />
            </IconButton>
            <HomeIconButton size="large" color="#ecf3f3" aria-label="edit" style={{ marginLeft: '0px', marginTop: '-50px' }}>
              <EditIcon />
            </HomeIconButton>
            <IconButton size="large" edge="end" color="#ecf3f3" aria-label="account">
              <AccountCircleIcon />
            </IconButton>
          </CenteredBox>
        </Toolbar>
      </StyledAppBar>

      {/* Barra de navegación */}
      <NavigationComponent />
    </div>
  );
}
